Reforma:
Tributária;
Política e Eleitoral (máximo 5 partidos, eleições distritais, fim do coeficiente partidário, fim do fundão eleitoral, fim da aposentadoria de ex-presidente, ex-governadores, ex-qualquer coisa, ...). Ainda sou a favor de limitar o exercício a 2 mandatos. Limite de 2 mandatos como vereador, 2 como deputado estadual, 2 como deputado federal, 2 como governador, 2 para presidente e apenas 1 para o senado. Também obrigar que para ser deputado estadual o candidato deve ter tido ao menos 1 mandato como vereador. Para deputado federal ou senador, ao menos 1 mandato como deputado estadual. O mesmo para os cargos executivos: prefeito, governador e presidente. 
Fim dos VICES.
Na morte, renúncia ou afastamento do titular, um governo provisório assume até novas eleições em poucos meses após a vacância;
Forma de nomeação para ministros stf (por enquanto em minúsculas), quem pode ocupar uma vaga, o tempo limite para exercício e formas alternativas para impeachment. Como um exemplo hipotético: se um abaixo assinado tiver mais assinaturas que o senador MAIS VOTADO no Brasil no último pleito ao da legislatura em curso, torna-se obrigatório levar a votação para o plenário;
Aprimoramento do código Civil, Processual e Penal;
Muitas outras pautas eu poderia sugerir mas, na minha opinião, a mais importante, crucial é ...

... pela CRIMINALIZAÇÃO DO SOCIALISMO/COMUNISMO como já foi na: Letônia, Indonésia, Polônia, Ucrânia, Lituânia, Geórgia e Moldávia.
